// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;
import "@openzeppelin/contracts/access/AccessControl.sol";

contract StorageAlert is AccessControl {

  bytes32 public constant WRITER_ROLE = keccak256("WRITER_ROLE");
  bytes32 public constant ADMIN = keccak256("ADMIN");

  struct Alerts {
    address reporter;
    string name;
    string composition;
    string location;
    uint timeStamp;
    string comment;
  }
  mapping(uint => Alerts) alert;
  uint public alertCounter;

  // Event
  event AlertCreated(address reporter, string name, string composition, string location, uint timeStamp, string comment);

  constructor () {
    _setupRole(WRITER_ROLE, msg.sender);
    _setupRole(ADMIN, msg.sender);
  }

  // Feed alerts on-chain and later on 
  function createAlert(
    string memory _name, 
    string memory _composition, 
    string memory _location, 
    string memory _comment,
    uint _timeStamp
    ) external {
      require(hasRole(WRITER_ROLE, msg.sender), "Not writer");
      alertCounter++;
      alert[alertCounter] = Alerts(
        msg.sender,
        _name,
        _composition,
        _location,
        _timeStamp,
        _comment
      );
    emit AlertCreated(msg.sender,_name, _composition, _location, _timeStamp, _comment);
  }

  // Grant writing role to checkers
  function grantWritingControl(address _newWriterAddress) external {
    require(hasRole(ADMIN, msg.sender), "Not admin");
    _setupRole(WRITER_ROLE, _newWriterAddress);
  }

  // This function checks if user is a verified checker, so that they can feed data in front-end or not
  function isChecker(address _isCheckerAddress) external view returns(bool) {
    return hasRole(WRITER_ROLE, _isCheckerAddress);
  }

  // return alert by alertId
  function getAlert(uint _alertId) external view returns(Alerts memory) {
    return alert[_alertId];
  }

}

